@Test
public void updateStatus(){
	String jsonStr = "[{\"id\":68,\"createDate\":1489887903000,\"status\":\"PASS\"},{\"id\":828,\"createDate\":1525775211000,\"status\":\"PASS\"}]";
	JSONArray jsonArray = JSONArray.fromObject(jsonStr);
	JSONObject jsonObject;
	List<Panorama> panoramas = panoramaService.findAll();
	Panorama panorama;
	Date date;
	for(int i = 0;i<panoramas.size();i++){
		panorama = panoramas.get(i);
		for(int j = 0;j<jsonArray.size();j++){
			jsonObject = (JSONObject) jsonArray.get(j);
			if(panorama.getId().toString().equals(jsonObject.get("id").toString())){
				Calendar c = Calendar.getInstance();
				c.setTimeInMillis(jsonObject.getLong("createDate"));
				date = c.getTime();
				panorama.setCreateDate(date);
				panorama.setStatus(CommonEnum.Review.valueOf(jsonObject.getString("status")));
				panoramaService.save(panorama);
			}
		}
	}

}

